<script type="module">
  import { getJwtUserInfo } from "@bytecloud/common-lib";

  const MONITOR_URL = 'https://aipa-api.bytedance.net/api/monitor/micro-app';
  
  function getDeviceInfo() {
    const ua = navigator.userAgent;
    const isMobile = /Mobile|Android|iPhone|iPad/i.test(ua);
    return {
      userAgent: ua,
      isMobile,
      platform: navigator.platform,
    };
  }

  async function sendMonitorData() {
    const userInfo = await getJwtUserInfo('online');
    
    await fetch(MONITOR_URL, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        appId: '67fb7f1dc22f1c005004fe4c',
        userEmail: userInfo.email,
        userName: userInfo.username,
        userAvatar: userInfo.avatar_url,
        organization: userInfo.organization,
        referer: document.referrer || '',
        device: getDeviceInfo()
      }),
    });
  }

  sendMonitorData();
</script>
